var videoData = "data:video/mp4;base64,"
const isVideoPlaying = video => !!(video.currentTime > 0 && !video.paused && !video.ended && video.readyState > 2);

function main() {
    'use strict';

    var getTime = function () {
        return new Date().getTime();
    };

    var funDownload = function (content, filename) {
        var eleLink = document.createElement('a');
        eleLink.download = filename;
        eleLink.style.display = 'none';
        var blob = new Blob([content]);
        eleLink.href = URL.createObjectURL(blob);
        document.body.appendChild(eleLink);
        eleLink.click();
        document.body.removeChild(eleLink);
    };
    var status = false;
    var initTime = getTime();
    var playing = true;
    var buffer = false;
    const config = {
        attributes: true, childList: true, subtree: true
    };
    var targetNode;
    var observer;
    var contentNode;
    var videoNode;
    const callback = mutations => {
        mutations.forEach(mutation => {
            if (mutation.type === 'attributes') {
                if (mutation.type === "attributes") {
                    // console.log(`The ${mutation.attributeName} attribute was modified.`);
                    console.log(mutation.target.innerText.trim());
                    if (mutation.target.innerText.trim().length != 0) {
                        // start playing
                        if (!isVideoPlaying(videoNode)) {
                            console.log(mutation.target.innerText.trim())
                            console.log(videoNode);
                            videoNode.play();
                            setTimeout(() => {
                                // put image back
                                videoNode.pause();
                                videoNode.currentTime = 0.3;
                                console.log("resetted");
                            }, mutation.target.innerText.trim().length * 25);
                        }
                    };
                }
            }
        });
    }

    console.log("here");

    var controlelement = document.createElement("div");
    controlelement.setAttribute("id", "controlPanel");
    controlelement.style.marginLeft = "5px"
    controlelement.style.marginRight = "5px"
    controlelement.style.fontSize = "16px";
    controlelement.style.cssText = "max-width:60%;min-width: 150px;padding:0 14px;min-height: 20px;color: rgb(255, 255, 255);line-height: 20px;text-align: center;border-radius: 4px;position: fixed;top: 5%;Right: 10%;transform: translate(-50%, -50%);z-index: 999999;background: rgba(255, 255, 255,.7);font-size: 16px;";
    var inputStart = document.createElement("input")
    inputStart.type = "button";
    inputStart.value = "Start"
    inputStart.onclick = function () {
        targetNode = document.getElementsByClassName("flex flex-col pb-9 text-sm")[0];
        console.log(targetNode);
        observer = new MutationObserver(callback);
        observer.observe(targetNode, config);
        status = true;

        initTime = getTime();
        let a = document.getElementById("controlPanel")
        a.parentElement.removeChild(a)

        contentNode = document.createElement("div");
        contentNode.setAttribute("id", "contentNode");
        contentNode.style.marginLeft = "0px"
        contentNode.style.marginRight = "0px"
        contentNode.style.fontSize = "16px";
        contentNode.style.cssText = "max-width:60%;min-width: 208px;padding:0 14px;min-height: 208px;color: rgb(0, 0, 0);line-height: 20px;text-align: center;border-radius: 4px;position: fixed;bottom: -104px;right: -104px;transform: translate(-50%, -50%);z-index: 999999;background: rgba(0, 0, 0,.7);font-size: 16px;";

        const videoContent = `<video width="208" height="208" loop muted><source src="` + videoData + `" type="video/mp4">Your browser does not support the video tag.</video>`
        contentNode.innerHTML = videoContent;
        document.body.appendChild(contentNode);
        videoNode = contentNode.getElementsByTagName("video")[0];
        videoNode.currentTime = 0.3;
    }

    // var p = document.createElement("span")
    // p.id = "Time"
    // p.textContent = "10"
    // p.style = "color: white"
    // controlelement.appendChild(p)
    controlelement.appendChild(inputStart)
    // var showTime = document.createElement("input")
    // showTime.type = "button";
    // showTime.value = "Show"
    // showTime.onclick = function (){

    // }
    // var hideTime = document.createElement("input")
    // hideTime.type = "button";
    // hideTime.value = "Hide"
    // hideTime.onclick = function (){

    // }
    // controlelement.appendChild(showTime)
    // controlelement.appendChild(hideTime)

    document.body.appendChild(controlelement);
};

function Toast(msg, duration) {
    duration = isNaN(duration) ? 3000 : duration;
    var m = document.createElement('div');
    m.textContent = msg;
    m.style.cssText = "max-width:60%;min-width: 150px;padding:0 14px;height: 40px;color: rgb(255, 255, 255);line-height: 40px;text-align: center;border-radius: 4px;position: fixed;top: 50%;left: 50%;transform: translate(-50%, -50%);z-index: 999999;background: rgba(0, 0, 0,.7);font-size: 16px;";
    document.body.appendChild(m);
    setTimeout(function () {
        var d = 0.5;
        m.style.webkitTransition = '-webkit-transform ' + d + 's ease-in, opacity ' + d + 's ease-in';
        m.style.opacity = '0';
        setTimeout(function () { document.body.removeChild(m) }, d * 1000);
    }, duration);
}
